import React from 'react';
import Navbar from './navbar.js';

function Dashboard() {
  return (
    <div className="h-screen bg-purple flex justify-center items-center">
      <Navbar />
      <div className="w-5/6 h-5/6 bg-darkgrey rounded-xl shadow-xl p-8 ">
            <div class="w-96 h-72  absolute inset-x-0 bottom-0 items-center ">
              <div class="w-72 h-64 bg-silver left-[29px] top-[39px] bg-zinc-300 rounded-2xl shadow"></div>
              <div class="w-72 h-64 bg-silver left-[370px] top-[39px] absolute bg-zinc-300 rounded-2xl shadow"></div>
              <div class="w-72 h-64 bg-silver left-[711px] top-[39px] absolute bg-zinc-300 rounded-2xl shadow"></div>
              <div class="w-40 h-11 bg-silver left-[64px] top-[59px] absolute text-black text-2xl font-normal font-['Abel'] tracking-tight">TOTAL COMMENTS</div>
            </div>
      </div>
    </div>
  );
}

export default Dashboard;
